(function (win, doc) {



    var gradation = new Image,
        sub = doc.createElement("canvas"),
        i = 0,
        rad = 0,
        SIZE = 600;

    gradation.onload = handleLoad;

    gradation.src = "data:image/jpeg;base64,";

    function handleLoad() {
        var drawGradation, drawBtn;

        drawGradation = buildGradation();
        drawBtn = buildBtn();

        setInterval(function () {
            rad = (rad + 1) % 360;
            drawGradation(rad);
            drawBtn();
        }, 1000 / 24);
    }

    function buildGradation() {
        var ctx = sub.getContext("2d");

        sub.width = sub.height = SIZE;

        function draw(rad) {
            ctx.save();
            ctx.translate(SIZE / 2, SIZE / 2);
            ctx.rotate(rad * Math.PI / 180);
            ctx.translate(-SIZE / 2, -SIZE / 2);
            ctx.drawImage(gradation, 0, 0, SIZE, SIZE);
            ctx.rotate(-45 * Math.PI / 180);
            ctx.restore();
        }

        return draw;
    }

    function buildBtn() {
        var canvas = doc.getElementById("canvas"),
            ctx = canvas.getContext("2d"),
            LINE_WIDTH = 1,
            SIZE = 60;

        function draw() {
            canvas.width = SIZE;
            canvas.height = SIZE;

            ctx.save();
            ctx.drawImage(sub, 0, 0, SIZE, SIZE);
            ctx.globalCompositeOperation = "destination-in";
            ctx.lineWidth = LINE_WIDTH;
            ctx.arc(SIZE / 2, SIZE / 2, SIZE * 0.4, 0, Math.PI * 2, true);
            ctx.stroke();
            ctx.restore();
        }

        return draw;
    }


})(this, document);

